<div class="entities" style="line-height: 2.5; direction: ltr">Alpha synuclein is transported into and out of the brain by the blood-brain barrier . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P37840
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( -Syn ) , a small protein with multiple physiological and pathological functions , is one of the dominant proteins found in Lewy Bodies , a pathological hallmark of Lewy body disorders , including Parkinson ' s disease ( PD ) . More recently , -Syn has been found in body fluids , including blood and cerebrospinal fluid , and is likely produced by both peripheral tissues and the central nervous system . Exchange of -Syn between the brain and peripheral tissues could have important pathophysiologic and therapeutic implications . However , little is known about the ability of -Syn to cross the blood-brain barrier ( BBB ) . Here , we found that radioactively labeled -Syn crossed the BBB in both the brain-to-blood and the blood-to-brain directions at rates consistent with saturable mechanisms .

 - related protein - 1 (

<div class="entities" style="line-height: 2.5; direction: ltr">Generation and properties of a new human ventral mesencephalic neural stem cell line . Neural stem cells ( NSCs ) are powerful research tools for the design and discovery of new approaches to cell therapy in neurodegenerative diseases like Parkinson ' s disease . Several epigenetic and genetic strategies have been tested for long-term maintenance and expansion of these cells in vitro . Here we report the generation of a new stable cell line of human neural stem cells derived from ventral mesencephalon ( hVM 1 ) based on v-myc immortalization . The cells expressed neural stem cell and radial glia markers like nestin , vimentin and 3CB2 under proliferation conditions . After withdrawal of growth factors , proliferation and expression of v-myc were dramatically reduced and the cells differentiated into astrocytes , oligodendrocytes and neurons . hVM 1 cells yield a large number of dopaminergic neurons ( about 12 % of total cells are TH + ) after differentiation , which also produce dopamine . In addition to proneural genes ( Q9H2A3 , MASH 1 ) , differentiated cells show expression of several genuine mesencephalic dopaminergic markers such as : Q8TE12 , O60663 ,

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Sources contributing to the average extracellular concentration of dopamine in the nucleus accumbens . Mesolimbic dopamine neurons fire in both tonic and phasic modes resulting in detectable extracellular levels of dopamine in the nucleus accumbens ( NAc ) . In the past , different techniques have targeted dopamine levels in the NAc to establish a basal concentration . In this study , we used in vivo fast scan cyclic voltammetry ( FSCV ) in the NAc of awake , freely moving rats . The experiments were primarily designed to capture changes in dopamine caused by phasic firing - that is , the measurement of dopamine ' transients ' . These FSCV measurements revealed for the first time that spontaneous dopamine transients constitute a major component of extracellular dopamine levels in the NAc . A series of experiments were designed to probe regulation of extracellular dopamine . DB00281 was infused into the ventral tegmental area , the site of dopamine cell bodies , to arrest neuronal firing . While there was virtually no instantaneous change in dopamine concentration , longer sampling revealed a decrease in dopamine transients and a time-averaged decrease in the extracellular level . Dopamine transporter inhibition using intravenous GBR 12909 injections increased extracellular dopamine levels changing both frequency and size of dopamine transients in the NAc . To further unmask the mechanics governing extracellular dopamine levels we used intravenous injection of the vesicular monoamine transporter ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) inhibitor , tetrabenazine , to deplete dopamine storage and increase cytoplasmic dopamine in the nerve terminals . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Additive antiproteinuric effect of angiotensin II receptor antagonist and angiotensin-converting enzyme inhibitor in patients with chronic glomerulonephritis ] .

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 alone reduced proteinuria by 13 % . Combination of these two drugs induced a more remarkable reduction of proteinuria ( 48 % ; p &lt; 0.05 vs other periods ) . The decrease in mean blood pressure by the combination therapy was significantly correlated with the decrease in proteinuria . The combination of drugs also reduced the amount of urinary type-IV collagen excretion . An additive effect of ACEI and ARB on proteinuria and urinary type-IV collagen excretion was recognized in patients with chronic glomerulonephritis .</div>

 inhibitor reserpine , possibly reflecting a functional deficiency of dopamine . Indeed , mice at 15 months of age had significantly reduced levels of dopamine and its major metabolite DOPAC in the striatum , and reduced levels of dopamine in the mesolimbic system . The present study confirms that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 plays an important role in the development of PD and an insertion of a single point mutation is sufficient to generate age-related decline in specific motor performance . The generated mouse line has a potential to become a model for PD with comparable time course and phenotype .</div>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - directed monoclonal antibodies in non-small cell lung cancer . Several monoclonal antibodies directed against the epidermal growth factor receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) have been evaluated in patients with non-small cell lung cancer ( NSCLC ) . Cetuximab , a chimeric monoclonal antibody , has been studied in combination with first-line chemotherapy in phase II and two phase III trials in patients with advanced NSCLC . The phase III FLEX trial demonstrated an increase in survival for cisplatin / vinorelbine plus cetuximab compared to chemotherapy alone in patients with advanced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - expressing NSCLC . Cetuximab added to carboplatin / paclitaxel failed to improve progression-free survival in the BMS 099 phase III trial . However , a meta-analysis of four randomized trials confirmed a significant survival benefit for platinum-based chemotherapy plus cetuximab compared to chemotherapy alone . High 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533

</mark>
 expression of tumor cells was then shown to predict the benefit of cetuximab , whereas 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01116
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 mutations and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 fluorescent in situ hybridization analysis were without predictive value . DB05101 and panitumumab have also been studied in phase II trials . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , a fully human monoclonal antibody , is currently evaluated in combination with chemotherapy in two phase III trials in patients with advanced NSCLC . Cetuximab is also studied in combination with chemoradiotherapy in patients with locally advanced NSCLC .</div>

 decreases alpha-synuclein level and alpha-synuclein-induced toxicity .

 dramatically increased the expression of HSP 70 in SH-SY 5Y cells , and significantly decreased the level and cytotoxicity of alpha-synuclein . Taken together , these data indicate that dominant-positive 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 plays an important role in suppressing alpha-synuclein aggregation and toxicity in SH-SY 5Y cells . Parkinson ' s disease which is marked by alpha-synuclein aggregation may be treated by increasing a set of endogenous heat shock proteins .</div>
